window.bookSummaryJSON = "<p><b>Instant Number One New York Times Best Seller</b>&nbsp;</p> <p><b>Transform your life or the life of someone you love with </b><b><i>Life Force - </i></b><b>the newest breakthroughs in health technology to help maximize your energy and strength, prevent disease, and extend your health span - from Tony Robbins, author of the number one </b><b><i>New York Times</i></b><b> best seller </b><b><i>Money: Master the Game.</i></b></p> <p>What if there were scientific solutions that could wipe out your deepest fears of falling ill, receiving a life-threatening diagnosis, or feeling the effects of aging? What if you had access to the same cutting-edge tools and technology used by peak performers and the world’s greatest athletes?</p> <p>In a world full of fear and uncertainty about our health, it can be difficult to know where to turn for actionable advice you can trust. Today, leading scientists and doctors in the field of regenerative medicine are developing diagnostic tools and safe and effective therapies that can free you from fear.</p> <p>In this book, Tony Robbins, the world’s number one life and business strategist who has coached more than 50 million people, brings you more than 100 of the world’s top medical minds and the latest research, inspiring comeback stories, and amazing advancements in precision medicine that you can apply today to help extend the length and quality of your life.</p> <p>This book is the result of Robbins going on his own life-changing journey. After being told that his health challenges were irreversible, he experienced firsthand how new regenerative technology not only helped him heal but made him stronger than ever before.</p> <p><i>Life Force </i>will show you how you can wake up every day with increased energy, a more bulletproof immune system, and the know-how to help turn back your biological clock. This is a book for everyone, from peak performance athletes, to the average person who wants to increase their energy and strength, to those looking for healing. <i>Life Force</i> provides answers that can transform and even save your life, or that of someone you love.</p>"; 
